function Init()
  PlaySfxGraphicBack()
  AddSCUI_Elements()
  Amax.ChangeUiCamera("Sp_3", UIGlobals.CameraLerpTime, 0)
  StoreInfoLine()
  RaceSummary_SetupInfoLines()
  SetupRaceSummaryResults()
  SetupRivalAndPrey()
  GUI.Progression = Multiplayer.ProfileProgression()
  Mp_RankIcon(SCUI.name_to_id.player_rank, GUI.Progression.level - 1, GUI.Progression.legend)
  GUI.Progression = Multiplayer.ProfileProgression()
  if GUI.Progression.maxed == false then
  end
  UIButtons.ChangeSize(SCUI.name_to_id.progress, UIButtons.GetSize(SCUI.name_to_id.backing) * ((GUI.Progression.fans - Multiplayer.LevelProgressionData(GUI.Progression.level).fans_previous) / (Multiplayer.LevelProgressionData(GUI.Progression.level).fans_needed - Multiplayer.LevelProgressionData(GUI.Progression.level).fans_previous)), UIButtons.GetSize(SCUI.name_to_id.backing))
  GUI.race_summary = Multiplayer.GetRaceSummary()
  GUI.race_results = Multiplayer.GetLobbyRaceResults()
end
function PostInit()
  SetupScreenTitle(UIText.MP_RACE_SUMMERY, SCUI.name_to_id.ScreenTitle_Dummy, nil, nil, nil, nil, true, nil, UIEnums.Panel._3DAA_WORLD)
  UIButtons.TimeLineActive("Hide_Lobby", true)
  UIButtons.TimeLineActive("show_left_arrow", false)
  UIButtons.SetActive(SCUI.name_to_id.Left_Arrow, false)
  if NetRace.IsPrivateGame() == true then
    UIButtons.SetActive(SCUI.name_to_id.Right_Arrow, false)
    UIButtons.TimeLineActive("show_right_arrow", false)
  else
    UIButtons.TimeLineActive("show_right_arrow", true)
  end
  UIButtons.SetActive(SCUI.name_to_id.darken, true)
  UIButtons.ChangeText(SCUI.name_to_id.on_track_fans_text, "MPL_STATS_ON_TRACK_FANS")
  UIButtons.ChangeText(SCUI.name_to_id.on_finish_bonus_position_text, "MPL_STATS_POSITION_FINISH_BONUS")
  UIButtons.ChangeText(SCUI.name_to_id.on_finish_bonus_text, "MPL_STATS_FINISH_BONUS")
  UIButtons.ChangeText(SCUI.name_to_id.fan_total_text, "MPL_STATS_TOTAL_FANS")
  if 0 < GUI.race_summary.showy_flourish_fans then
    UIButtons.SetActive(SCUI.name_to_id.fan_multipliers_text, false)
    UIButtons.SetActive(SCUI.name_to_id.showy_flourish, true)
    UIButtons.ChangePosition(SCUI.name_to_id.showy_flourish, UIButtons.GetPosition(SCUI.name_to_id.showy_flourish))
    UIButtons.ChangeText(SCUI.name_to_id.showy_flourish_amount, "GAME_NUM_" .. GUI.race_summary.showy_flourish_fans)
    UIButtons.ChangePosition(SCUI.name_to_id.showy_flourish_text, -(UIButtons.GetStaticTextLength(SCUI.name_to_id.showy_flourish_text, true) + 1 + UIButtons.GetStaticTextLength(SCUI.name_to_id.showy_flourish_amount)) * 0.5, nil, nil)
  end
  if 0 < GUI.race_summary.fan_favourite_fans then
    UIButtons.SetActive(SCUI.name_to_id.fan_multipliers_text, false)
    UIButtons.SetActive(SCUI.name_to_id.fan_favourite, true)
    UIButtons.ChangePosition(SCUI.name_to_id.fan_favourite, UIButtons.GetPosition(SCUI.name_to_id.fan_favourite))
    UIButtons.ChangeText(SCUI.name_to_id.fan_favourite_amount, "GAME_NUM_" .. GUI.race_summary.fan_favourite_fans)
    UIButtons.ChangePosition(SCUI.name_to_id.fan_favourite_text, -(UIButtons.GetStaticTextLength(SCUI.name_to_id.fan_favourite_text, true) + 1 + UIButtons.GetStaticTextLength(SCUI.name_to_id.fan_favourite_amount)) * 0.5, nil, nil)
  end
  if 0 < GUI.race_summary.car_reward_fan_bonus then
    UIButtons.SetActive(SCUI.name_to_id.fan_multipliers_text, false)
    UIButtons.SetActive(SCUI.name_to_id.car_bonus, true)
    UIButtons.ChangePosition(SCUI.name_to_id.car_bonus, UIButtons.GetPosition(SCUI.name_to_id.car_bonus))
    UIButtons.ChangeText(SCUI.name_to_id.car_bonus_amount, "GAME_NUM_" .. GUI.race_summary.car_reward_fan_bonus)
    UIButtons.ChangePosition(SCUI.name_to_id.car_bonus_text, -(UIButtons.GetStaticTextLength(SCUI.name_to_id.car_bonus_text, true) + 1 + UIButtons.GetStaticTextLength(SCUI.name_to_id.car_bonus_amount)) * 0.5, nil, nil)
  end
  if 0 < Multiplayer.GetRaceChallengesComplete() then
    GUI.CompletedChallengeFans = Multiplayer.GetRaceChallengesCompleteFans()
    UIButtons.SetActive(SCUI.name_to_id.challenges_bonus_text, false)
    if Multiplayer.GetRaceChallengesComplete() > 3 then
      UIButtons.SetActive(SCUI.name_to_id.challenge_bonus_multiple, true)
      UIButtons.ChangePosition(SCUI.name_to_id.challenge_bonus_multiple, UIButtons.GetPosition(SCUI.name_to_id.challenge_bonus_multiple))
      UIButtons.ChangeText(SCUI.name_to_id.challenge_bonus_multiple_amount, "GAME_NUM_" .. GUI.CompletedChallengeFans.Total_Fans)
      UIButtons.ChangeText(SCUI.name_to_id.challenge_bonus_multiple_text, "GAME_LOBBY_RACESUMMARY_CHALLENGE_MULTIPLE" .. Multiplayer.GetRaceChallengesComplete())
      UIButtons.ChangePosition(SCUI.name_to_id.challenge_bonus_multiple_text, -(UIButtons.GetSize(SCUI.name_to_id.challenge_bonus_multiple_text) + 1 + UIButtons.GetStaticTextLength(SCUI.name_to_id.challenge_bonus_multiple_amount)) * 0.5, nil, nil)
    else
      if 0 < Multiplayer.GetRaceChallengesComplete() then
        UIButtons.SetActive(SCUI.name_to_id.challenge_bonus_I, true)
        UIButtons.ChangePosition(SCUI.name_to_id.challenge_bonus_I, UIButtons.GetPosition(SCUI.name_to_id.challenge_bonus_I))
        UIButtons.ChangeText(SCUI.name_to_id.challenge_bonus_I_text, GUI.CompletedChallengeFans.ChallengeName[0 + 1 + 1])
        UIButtons.ChangeText(SCUI.name_to_id.challenge_bonus_I_amount, "GAME_NUM_" .. GUI.CompletedChallengeFans.numFans[0 + 1 + 1])
        UIButtons.ChangePosition(SCUI.name_to_id.challenge_bonus_I_text, -(UIButtons.GetStaticTextLength(SCUI.name_to_id.challenge_bonus_I_text, true) + 1 + UIButtons.GetStaticTextLength(SCUI.name_to_id.challenge_bonus_I_amount)) * 0.5, nil, nil)
      end
      if 1 < Multiplayer.GetRaceChallengesComplete() then
        UIButtons.SetActive(SCUI.name_to_id.challenge_bonus_II, true)
        UIButtons.ChangePosition(SCUI.name_to_id.challenge_bonus_II, UIButtons.GetPosition(SCUI.name_to_id.challenge_bonus_II))
        UIButtons.ChangeText(SCUI.name_to_id.challenge_bonus_II_text, GUI.CompletedChallengeFans.ChallengeName[0 + 1 + 1 + 1])
        UIButtons.ChangeText(SCUI.name_to_id.challenge_bonus_II_amount, "GAME_NUM_" .. GUI.CompletedChallengeFans.numFans[0 + 1 + 1 + 1])
        UIButtons.ChangePosition(SCUI.name_to_id.challenge_bonus_II_text, -(UIButtons.GetStaticTextLength(SCUI.name_to_id.challenge_bonus_II_text, true) + 1 + UIButtons.GetStaticTextLength(SCUI.name_to_id.challenge_bonus_II_amount)) * 0.5, nil, nil)
      end
      if Multiplayer.GetRaceChallengesComplete() > 2 then
        UIButtons.SetActive(SCUI.name_to_id.challenge_bonus_III, true)
        UIButtons.ChangePosition(SCUI.name_to_id.challenge_bonus_III, UIButtons.GetPosition(SCUI.name_to_id.challenge_bonus_III))
        UIButtons.ChangeText(SCUI.name_to_id.challenge_bonus_III_text, GUI.CompletedChallengeFans.ChallengeName[0 + 1 + 1 + 1 + 1])
        UIButtons.ChangeText(SCUI.name_to_id.challenge_bonus_III_amount, "GAME_NUM_" .. GUI.CompletedChallengeFans.numFans[0 + 1 + 1 + 1 + 1])
        UIButtons.ChangePosition(SCUI.name_to_id.challenge_bonus_III_text, -(UIButtons.GetStaticTextLength(SCUI.name_to_id.challenge_bonus_III_text, true) + 1 + UIButtons.GetStaticTextLength(SCUI.name_to_id.challenge_bonus_III_amount)) * 0.5, nil, nil)
      end
    end
  end
  if GUI.race_summary.rank_up == true or 0 < Multiplayer.GetRaceChallengesComplete() then
    GUI.RankUpData = Multiplayer.POBProgressionForRank(GUI.race_summary.rank + 1)
    for _FORV_6_ = 1, 3 do
      GUI.unlock_nodes[_FORV_6_] = UIButtons.CloneXtGadgetByName("Multiplayer\\MpShowRaceSummary.lua", "unlock_node")
      UIButtons.AddListItem(SCUI.name_to_id.unlock_list, GUI.unlock_nodes[_FORV_6_])
    end
    _FOR_.SetActive(SCUI.name_to_id.new_unlocks, false)
  end
  if 0 < Multiplayer.GetRaceChallengesComplete() then
    if GUI.RankUpData == nil then
      GUI.RankUpData = {}
    end
    if GUI.RankUpData.unlocks == nil then
      GUI.RankUpData.unlocks = {}
    end
    GUI.RankUpData.unlocks.challenges = GUI.CompletedChallengeFans.ChallengeReward
  end
  if GUI.RankUpData ~= nil and GUI.RankUpData.unlocks ~= nil then
    RaceSummary_Progression_RefreshUnlocks(SCUI.name_to_id.unlock_list, GUI.unlock_nodes, GUI.RankUpData.unlocks)
  end
  GUI.UpcomingRankUpData = Multiplayer.POBProgressionForRank(GUI.race_summary.rank + 2)
  for _FORV_6_ = 1, 3 do
    GUI.upcoming_unlock_nodes[_FORV_6_] = UIButtons.CloneXtGadgetByName("Multiplayer\\MpShowRaceSummary.lua", "unlock_node")
    UIButtons.AddListItem(SCUI.name_to_id.upcoming_unlock_list, GUI.upcoming_unlock_nodes[_FORV_6_])
  end
  if _FOR_.UpcomingRankUpData ~= nil and GUI.UpcomingRankUpData.unlocks ~= nil then
    RaceSummary_Progression_RefreshUnlocks(SCUI.name_to_id.upcoming_unlock_list, GUI.upcoming_unlock_nodes, GUI.UpcomingRankUpData.unlocks)
  end
  FillRaceSummaryResults()
end
function MessageUpdate(_ARG_0_, _ARG_1_, _ARG_2_, _ARG_3_, _ARG_4_)
  if _ARG_0_ == UIEnums.Message.MenuNext and UIEnums.CurrentPlatform == UIEnums.Platform.Xenon then
    if GUI.current_screen_id == 1 and RaceSummary_CanViewGamerCard() == true then
      NetServices.ViewRaceSummaryGamerCard(Profile.GetPrimaryPad(), UIButtons.GetSelection(SCUI.name_to_id.node_list))
    end
  elseif _ARG_0_ == UIEnums.Message.MenuBack then
    PlaySfxBack()
    PopScreen()
  elseif _ARG_0_ == UIEnums.Message.ButtonRight then
    if GUI.current_screen_id == 1 and NetRace.IsPrivateGame() == false then
      UIButtons.TimeLineActive("MoveLeft_1", true, 0)
      GUI.current_screen_id = GUI.current_screen_id + 1
      RaceSummaryTransitionRightFinished()
      UIButtons.SetSelected(SCUI.name_to_id.node_list, false)
      UISystem.PlaySound(UIEnums.SoundEffect.StickersPage)
    end
  elseif _ARG_0_ == UIEnums.Message.ButtonLeft and GUI.current_screen_id == 2 then
    UIButtons.TimeLineActive("MoveLeft_1", false, 1)
    GUI.current_screen_id = GUI.current_screen_id - 1
    RaceSummaryTransitionLeftFinished()
    UIButtons.SetSelected(SCUI.name_to_id.node_list, true)
    UISystem.PlaySound(UIEnums.SoundEffect.StickersPage)
  end
end
function FrameUpdate(_ARG_0_)
end
function EnterEnd()
  RestoreInfoLine()
  UIButtons.TimeLineActive("Hide_Lobby", false)
  Amax.ChangeUiCamera(UIGlobals.CameraNames.MpLobby, UIGlobals.CameraLerpTime, 0)
  PlaySfxGraphicNext()
end
function End()
end
function RaceSummary_CanViewGamerCard()
  return NetServices.CanViewGamerCard(Profile.GetPrimaryPad()) == true
end
function RaceSummaryTransitionRightFinished()
  UIButtons.SetActive(SCUI.name_to_id.Right_Arrow, false)
  UIButtons.SetActive(SCUI.name_to_id.Left_Arrow, true)
  UIButtons.TimeLineActive("show_left_arrow", true)
  UIButtons.TimeLineActive("show_right_arrow", false)
  RaceSummary_SetupInfoLines()
end
function RaceSummaryTransitionLeftFinished()
  UIButtons.SetActive(SCUI.name_to_id.Right_Arrow, true)
  UIButtons.SetActive(SCUI.name_to_id.Left_Arrow, false)
  UIButtons.TimeLineActive("show_right_arrow", true)
  UIButtons.TimeLineActive("show_left_arrow", false)
  RaceSummary_SetupInfoLines()
end
